  const togglemode=()=>{
    if(mode==='light'){
      setmode='dark'
    }
    else{
      setmode='light'
    }
  }
  return (
  <>

 <Navbar title="Abdul Rafay" mode={mode} toggle={togglemode} Search="NotNow" />
  <Textform/>
  </>
  );
}

export default App;
